import React from "react";
import { Button, Card, Container, Form, Nav, Navbar } from "react-bootstrap";
import Logo from "./assets/img/Brasao_ufra.png";
const App = () => {
  return (
    <>
      <Navbar className="mt-1" bg="light" variant="light">
        <Container>
          <Navbar.Brand>
            <img
              src={Logo}
              width="50"
              height="50"
              className="d-inline-block align-top"
              alt="React Bootstrap logo"
            />
          </Navbar.Brand>
          <Navbar.Brand>Museu de Entomologia</Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse className="justify-content-end">
            <Button variant="outline-success">Login</Button>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Card className="mt-5" >
        <Form className="mx-auto p-3" >
          <label htmlFor="">  </label>
          <input type="text" />
        </Form>
      </Card>
    </>
  );
};

export default App;
